import { BrowserRouter as Router, Routes, Route ,Link,useNavigate} from "react-router-dom";
import Indexinter from "./components/Indexinter"


function App() {
  let navigate = useNavigate();

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route exact path="/index"><Indexinter/></Route>
          {/* <Route path="/add">
            <TestIndex/>
          </Route>
          <Route path="/list">
            <Todolist/>
          </Route>
          <Route path="/edit/:id">
            <Edit/>
          </Route> */}
          navigate("/home");
        </Routes>

      </div>
    </Router>
  );
}

export default App;
